import React from 'react'

function NameListKey() {

    const names = ['RatneshK', 'RajivK', 'NavinK']
    const nameList = names.map(name => <h2>{name}</h2>)

    return (

        <div>
            <h2>{nameList}</h2>            
        </div>
    )
}

export default NameListKey
